import React from 'react'
import {
  Animator,
  ScrollContainer,
  ScrollPage,
  batch,
  Fade,
  FadeIn,
  FadeOut,
  Move,
  MoveIn,
  MoveOut,
  Sticky,
  StickyIn,
  StickyOut,
  Zoom,
  ZoomIn,
  ZoomOut,
} from 'react-scroll-motion'
import styled from 'styled-components'
import { Margin24 } from '../../component/styledComponent'
const Container = styled.div`
  display: flex;
  flex-direction: row;
  width: 1280px;
  height: 600px;
`
const TextContainer = styled.div`
  display: flex;
  flex-direction: column;
  height: 600px;
  width: 436px;
  margin-right: 162px;
  padding-top: 24px;
  justify-content: flex-start;
  text-align: left;
`
const Title = styled.text`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 56px;
  line-height: 72px;
  color: #000000;
  white-space: nowrap;
`
const Description = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 18px;
  line-height: 36px;
  color: #656667;
`
const ButtonContanier = styled.div`
  width: 394px;
  height: 240px;
  background: #5500dd;
  border-radius: 24px;
  padding-top: 32px;
  padding-left: 48px;
`
const ButtonText = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 48px;
  color: #ffffff;
`
const Button = styled.button`
  width: 298px;
  height: 56px;
  background: #5500dd;
  border: 1px solid #ffffff;
  filter: drop-shadow(0px 4px 8px rgba(0, 0, 0, 0.24));
  border-radius: 36px;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 24px;
  color: #ffffff;
  display: flex;
  text-align: center;
  align-item: center;
  padding-left: 95px;
  padding-top: 16px;
  margin-top: 23px;
`
const LeftArrow = styled.div`
  margin-left: 47px;
`
const MainPageImage = styled.img`
  width: 600px;
  height: 600px;
`

export const Page5 = () => {
  return (
    <Animator animation={batch(Fade(), Sticky(), MoveOut(0, -200))}>
      <Container>
        <TextContainer>
          <Title>손쉬운 사용을 위한</Title>
          <Title>
            <text style={{ fontWeight: 700, color: '#5500dd' }}>가이드 북</text>
          </Title>
          <Margin24 style={{ backgroundColor: '#f5f4f7' }} />
          <Description>
            누구나 쉽게 이용할 수 있게 가이드라인을 제공해요.
          </Description>
          <Description>앞으로의 교회 생활을 주다와 함께해요.</Description>
          <Margin24 style={{ backgroundColor: '#f5f4f7' }} />
          <Margin24 style={{ backgroundColor: '#f5f4f7' }} />
          <ButtonContanier>
            <ButtonText>이제 교회 관리는</ButtonText>
            <ButtonText>주다와 함께하세요</ButtonText>
            <Button>
              고객 제휴 문의
              <LeftArrow>
                <img src="/source/icon/arrow_right_white.svg" />
              </LeftArrow>
            </Button>
          </ButtonContanier>
        </TextContainer>
        <MainPageImage src="/source/main_page_5.png" />
      </Container>
    </Animator>
  )
}
